import React from 'react'
import axios from 'axios'

export default class Issues extends React.Component {
  constructor (props) {
    super(props)
    this.state = {
      arr: []
    }
    this.getIssueList = this.getIssueList.bind(this)
  }

  componentDidMount () {
    window.addEventListener('load', this.getIssueList)
  }

  async getIssueList () {
    await axios
      .get(
        'http://localhost:8080/virtserver.swaggerhub.com/Kodstar/Issue_Tracker/1.0.0/issues'
      )
      .then(issues => {
        this.setState({
          arr: [...this.state.arr, issues.data]
        })
      })
      .catch(error => {
        console.log(error)
      })
  }

  render () {
    return (
      <article>
        <ul>
          {this.state.arr.map(issue=>{
            return <li key={issue.id}>{issue.title}</li>
          })}
        </ul>
      </article>
    )
  }
}
